Male. Integument blackish-brown. Dorsal vestiture (
Fig. 1
): rostrum and pronotum with a pale median longitudinal vitta formed by dense, yellowish, decumbent scales; lighter on rostrum; sides of rostrum and vertex with shiny brownish scales; antennae with fine, discrete whitish pubescence, denser at apex; antennal club with dense, shining, blackish-brown pubescence. Sides of pronotum and elytra (interstria 5 to epipleura) blackish-brown, densely interspersed with yellowish scales intermingled with few minute brown spots. Scutellum entirely yellowish. Elytra at base with yellowish interstriae 1 , and scutellar base intermingled with brownish scales posterior to gibbosities; interstriae 2 and 3 yellowish, interspersed with brownish between apical tubercles; interstria 4 with large blackish-brown areas, alternating with small irregular yellowish areas. Elytral apex yellowish with a lighter oblique stripe from tubercles to elytral apex. Pygidium with yellowish scales sparsely intermixed with brownish scales. Ventral vestiture: sides of body with dense, yellowish scales and setigerous punctures with a blackish-brown scale; in center sparser (except intercoxal process of mesosternum); beneath the eyes, with an elongate pale vitta, towards rostral apex; ventral surface of rostrum with moderately long, sparse whitish pubescence.

Rostrum twice as long as wide across base; dorsally impressed, median carina elongate and raised from apex to vertex; dorsolateral carinae elongate, subparallel, convergent only at apex. Sides of rostrum tricarinate (
Fig. 5
), lacking punctures; median carina thickened. Mentum finely punctuate and corrugated. Ventral region of rostrum impressed and lacking punctures; three elongate thickened carinae present. Eyes suboval, anterior margin oblique; front longer than wide; weakly impressed, median carina prominent on frons.

Antennae short (
Fig. 1
), reaching antebasal carina of prothorax; segments II–VIII subcylindrical, slightly impressed on medial and lateral sides, enlarged at apex; IX wider toward apex; IX and X dorsally flattened; II as long as half of III; IV–VII subequal, 1 / 3 shorter than III; VIII slightly shorter than VII;
IX 1
/ 3 longer than VIII; X about as long as wide;
XI 1
/ 3 longer than X, narrowed at apex.

Prothorax longer than wide. Pronotum with longitudinal depression in longitudinal vitta, deeper near anterior margin and near antebasal carina. Antebasal carina interrupted at middle (twice width of carina), subrectilinear; more oblique toward sides. Lateral carina lacking (
Fig. 2
). Secondary carina widely interrupted in middle, vestigial laterally. Laterobasal carina vestigal, with discrete and sparse nodules. Prosternum subplanar, smooth, with finely impressed sparse punctures; lacking grooves or depressions. Mesosternum with fine dense punctures; intercoxal process of mesosternum weakly impressed at apex, mesosternum rounded.

Discussion.

Hypselotropis jekeli


sp. nov.

is distinguished from other species of the genus by characters in the key and by the combination of the following characters: 
1
) longitudinal carina of the rostrum entirely raised from apex; 
2
) sides of rostrum tricarinate; 
3
) antennae short, reaching only antebasal carina of prothorax; segments II–VIII narrowed and feebly depressed (subcylindrical); 
4
) lacking longitudinal carina on pronotum; 
5
) lacking lateral carina on prothorax; 
6
) prosternum without either furrow or ante-coxal depression; 
6
) elytra strongly impressed along interstriae 
1
and 
2
, without interstrial costa; 
7
) anteapical tubercles present on interstria 
4
; 
8
) pygidium impressed only on each side of longitudinal furrow, subtruncate at apex; 
9
) ventrite V strongly impressed, slightly projected at apical angles.
